import {Outlet, useLoaderData} from 'react-router-dom';
import MainNavigation from '../MainNavigation';
function RootLayout(){
    useLoaderData();
    return(
        <>
        <MainNavigation/>
        <main>
            <Outlet/>
        </main>
        </>
    );
}

export default RootLayout;
